import {data} from "../api/data";
import Note from "./Note";

const ListNotes =()=> {

    return(
        <>
            {
                data.map((i)=>{
                    return <Note id={i.id} title_={i.title} content={i.content}/>
                }
                )
            }
        </>
    );
}

export default ListNotes;
